  text-align: center;
  margin-top: auto;
  border-top: 1px solid #e0e0e0;
`;

const Footer = () => {
  return (
    <FooterContainer>
      <p>&copy; 2025 BAMZZSTUDIO (bamzzstudio@gmail.com) All rights reserved.</p>
    </FooterContainer>
  );
};

export default Footer;
